var tipuesearch = {"pages": [{'title': '下學期網際內容管理', 'text': '\n', 'tags': '', 'url': '下學期網際內容管理.html'}, {'title': '課程進度', 'text': '', 'tags': '', 'url': '課程進度.html'}, {'title': '第三周', 'text': '更新cmsimde \n 簡化cmsimde/python wsgi.py 和 git push \n \n \n 先 git pull 把新的內容抓下來 \n \n \n 再把者五個檔案選起來複製 \n \n \n 貼到自己倉儲的目錄 \n \n \n 再來測試看看就可以了 \n \n \n 測試git add\xa0 git commit\xa0 git push 是否正常 \n \n', 'tags': '', 'url': '第三周.html'}, {'title': '第四~九週', 'text': "同步 github 和 heroku \n \n 要先依序設定這些 \n 完成後就可以在cmd登入你的heroku \n 再來就可以同步了 \n \n \n \n \n heroku 查詢課表app 建立過程 \n \n 先到老師的倉儲 git calone nfulist 到自己的倉儲 \n \n \n \n \n 點進來後修改 wsgi.py \n \n 去老師的wcm2021裡找 \n \n 再貼到這上面 \n 另存 檔名叫 wsgi.py 覆蓋掉原本 nfulist 裡的\xa0 wsgi.py \n \n 再來要把 proxy 屏蔽掉 \n 原因:在heroku開啟app時是外部的連線所以不需要設定proxy \n \n \n 還要新增這兩的變數 \n 1: semester = request.args.get('semester')\xa0 \n 2:classroomno = request.args.get('classroomno') \n 沒理解錯誤的話\xa0 semester 是控制第幾學年的第幾個學期 \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 classroomno 是控制要第幾間教室的課表 \n \n 都改完就可以把 nfulist 推到 heroku \n 再來打開 app \n \n \n \n 改改看變數 有成功換教室就是完成了 \n 中間要用問號隔開 \n ?classroomno=BGA0730 \n \n", 'tags': '', 'url': '第四~九週.html'}, {'title': '第十一週', 'text': '\n \n \n \n \n 在robodk裡要設置IP位址 \n \n \n \n 網路的連線也要更改，才能連線到老師的robodk \n \n \n \n \n 成功控制老師的robodk \n \n \n \n', 'tags': '', 'url': '第十一週.html'}, {'title': '第十四週', 'text': '\n', 'tags': '', 'url': '第十四週.html'}, {'title': '第十六週', 'text': '這裡是影片解說的部分\xa0 https://www.youtube.com/watch?v=7ncd-UmTHGg \n \n 首先要到 fossil.kmol.info:9443 登入 @gm.nfu 的帳號 \n \n \n 可以到 https://fossil.kmol.info/u/學號 看看有沒有成功 \n 如果有下面的畫面就可以了 \n \n \n 到 google 搜尋 fossil scm \n \n \n 到 download 下載 fossil \n \n \n fossil 下載後解壓縮放到 Y槽 \n \n \n 建立資料夾 \n \n \n \n \n 把 fossil clone 進來 \n \n 就會跑出這個檔案 (wd 是下一個步驟才會建置的資料夾) \n \n \n 建立資料夾 \n 建立後再到新建的 fossil 資料夾 打下面的指令 fossil open ./../../學號.fossil \n 裡面就會跑出 _FOSSIL_ 這個檔案 \n \n \n clone 自己的倉儲 到wd資料夾 \n \n \n 就會像這樣 \n \n \n 再把倉儲內的資料 clone 到自己學號的資料夾 \n \n \n 轉換到自己學號的目錄 \n 再輸入 fossil add . \n \n \n 等他跑完就可以 commit \n 這樣就可以了 (它會自動 push) \n \n \n 再來就可以測試看看由沒有成功 \n 跑出自己的倉儲動態網站就是成功了 \n', 'tags': '', 'url': '第十六週.html'}]};